import React from 'react'

function Home() {
  return (
    <div className="container">
      <div>
        <h1>Hello</h1>
          <p>Hey! I'm Michael. Coding has changed my world.
            It's not just about apps.
            Learning to code gave me problem-solving skills and a way to communicate with others on a technical level.
            I can also develop websites and use my coding skills to get a better job.
            I learned a basic level of my skills at leZion beRina high scoll in Naale programm and at SoloLearn.
            Then I improved them to advanced level at HackerU where I'm learnig today with a great teacher Zeev Mindali.
            You welcome to ask me for anything and I will try to give you the best answer that I can.
          </p>
      </div>
    </div>
  );
}

export default Home;
